import React from "react";
import { Card } from "antd";

const { Meta } = Card;
export default function ItemPhim({ phim }) {
  return (
    <div className="w-1/3">
      <Card
        hoverable
        style={{ width: 240 }}
        cover={<img alt="example" src={phim.hinhAnh} />}
      >
        <Meta title="Europe Street beat" description="www.instagram.com" />
      </Card>
    </div>
  );
}
